def cricdata(id):
	headers={"cookie": "pc=1; cb_config=%7B%7D; cbzads=IN|not_set|not_set|not_set; cbgeo=IN; _ga=GA1.2.1884059886.1591800123; _gid=GA1.2.1945408516.1591800123; _col_uuid=a532d4ee-278e-4eda-a507-7c436cccb429-1siqx; __gads=ID=250bd9a3651ccd61:T=1591800123:S=ALNI_Mb1Oc_P7Wu0QsnDEMqndlpVv_BmTw; _gat_UA-312277-1=1","user-agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/83.0.4103.97 Safari/537.36"}
	res=requests.get("https://www.cricbuzz.com/profiles/"+str(id),headers=headers)
	soup=BeautifulSoup(res.text,'lxml')
	raw_list=soup.find(class_='cb-hm-rght')
	lis=raw_list.find_all('div')
	data=[]
	for i in lis:
		data.append(i.text)
	return [data[2],data[4],data[6]]

def geolocation(address):
	res = requests.get("https://maps.googleapis.com/maps/api/geocode/json?address="+address+"&key=AIzaSyA-6Vypns_l5ACf-vo9C3OrRAAaKUJ6La0").json()
	#print(res)
